import {
    Box,
    Card,
    CardContent,
    CardMedia,
    Typography,
    Grid,
    Stack,
    Button,
    makeStyles,
  } from "@mui/material";
import { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { config } from "../App";
import WhatshotOutlinedIcon from '@mui/icons-material/WhatshotOutlined';
import ScheduleOutlinedIcon from '@mui/icons-material/ScheduleOutlined';
import { Link } from "react-router-dom";
import './homepage.css'

import {  getRecipes } from "../features/recipeSlice";
const Homepage=()=>{
   const { recipes } = useSelector((state) => state.recipe);
   const dispatch = useDispatch();

  //  console.log(recipes)
//  const [recipe,setRecipe] = useState()

  useEffect(() => {
   getRecipe();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);
  const getRecipe = async () => {
    let response = {};
    let errored = false;

    try {
      response = await (
        await fetch(`${config.endpoint}/recipe`, {
          method: "GET",
        })
      ).json();
    } catch (e) {
      errored = true;
      return errored;
    }
    dispatch(getRecipes(response))
    return recipes
    // dispatch(getRecipe(response));
  };
  console.log(recipes)
  const useStyles = makeStyles({
    flexGrow: {
      flex: '1',
    },
    button: {
      backgroundColor: '#3c52b2',
      color: '#fff',
      '&:hover': {
        backgroundColor: '#fff',
        color: '#3c52b2',
    },
  }})
  return (
        <Box style={{display:"flex",justifyContent:"center"}}>
             {typeof recipes !== "undefined" && (
          <Grid container spacing={2} sx={{ m: 2 }} alignItems="stretch" justifyContent="center" style={{width:"80vw"}}>
            {recipes.map((ele) => {
              return (
                <Grid item  xs={8} md={3} key={ele._id} className="recipe-grid">
                  <Link to={"/recipe/" + ele._id} className="recipe-tile-link" style={{textDecoration:"none"}}>
                    <Card className="recipe-tile" sx={{ maxWidth: 345 }}>
                    <div className="overlay">
                        <div className="text">
                        <img src="https://drive.google.com/uc?export=view&id=1B7YbaIMNKI1Yu7MG_AXKMP1hhh4dn-FD" style={{height:"100px"}}/> 
                        <div>
                       <Button variant="contained" className="cook-btn">let's cook</Button>
                          </div>
                        </div>
                      </div>
                      <CardMedia
                        // style={{ height: "70%" }}
                        className="image"
                        sx={{ height: 200 }}
                        component="img"
                        image={ele.image}
                        alt={ele.title}
                      />
                      <CardContent>
                        <Box>
                        <Typography
                          component="h5"
                          variant="h5"
                          className="nheadingrs"
                        >
                          {ele.title}
                          <span className="rsvegnonveg veg"><span className="veg"></span></span>
                        </Typography>
                       

                        </Box>
                        <Box style={{display:"flex",justifyContent:'space-between',padding:"10px"}}>
                        <Stack direction="row" alignItems="center">
                          <WhatshotOutlinedIcon style={{height:"20px" ,color:"red"}} />
                          <Typography
                            variant="subtitle1"
                            color="textSecondary"
                          >
                        {ele.calories}

                          </Typography>
                      </Stack>
                      <Stack direction="row" alignItems="center" gap="2px">
                        <ScheduleOutlinedIcon style={{height:"20px"}}/>
                          <Typography
                            variant="subtitle1"
                            color="textSecondary"
                          >
                            {ele.prepTime}
                          </Typography>
                        </Stack>
                          </Box>
                      </CardContent>
                    </Card>
                  </Link>
                </Grid>
              );
            })}
          </Grid>
          )}

      </Box>
    )
}
export default Homepage
